Polkaswap SORA komunitateak mantentzen du. Polkaswap funtzionalitatea erabili aurretik, berrikusi %%Polkaswap FAQ%% eta dokumentazioa, Polkaswap-en funtzionamenduari buruzko azalpen zehatza, Polkaswap Memoria eta Zerbitzuen Baldintzak eta Pribatutasun Politika barne. Dokumentu hauek funtsezkoak dira erabiltzaile esperientzia segurua eta positiboa lortzeko. Polkaswap erabiliz, dokumentu hauek irakurri eta ulertu dituzula aitortzen duzu. 

 Honako hau ere aitortzen duzu: 

 1) zure legezko jurisdikzioan Polkaswap-en erabilera partikularrean aplika daitezkeen lege guztiak betetzearen erantzukizun bakarra;
 2) ulertzen duzu Polkaswap-en uneko bertsioa alfa bertsioa dela: ez da guztiz probatu, eta baliteke funtzio batzuek diseinatutakoa ez betetzea;
 3) Polkaswap erabiltzeak dakartzan arriskuak ulertzea eta borondatez onartzea, besteak beste, tokens galtzeko arriskua barne. Beste behin ere, jarraitu ezazu FAQ, Polkaswap Memorandum eta Zerbitzu Baldintzak eta Pribatutasun Politika irakurri gabe.

